  heading: {
    margin: 24,
    fontSize: 18,
    // fontWeight: 'bold',
    textAlign: 'center',
  },
});

const Instructions = () => {
  const view = (
    <Text style={styles.heading}>
      Anim ea ad magna consectetur ut commodo sit in
      veniam aliqua eiusmod adipisicing cillum do cupidatat
      consequat nisi voluptate do cillum excepteur in.
    </Text>
  );
  return view;
};

export default Instructions;
